-- Run this in DBeaver against database 'analyse_stocks' (public schema)
BEGIN;

CREATE TABLE IF NOT EXISTS symbol_resolution (
    isin VARCHAR(20) PRIMARY KEY,
    symbol VARCHAR(20) NOT NULL,
    name VARCHAR(255),
    source VARCHAR(50),
    updated_at TIMESTAMP WITH TIME ZONE
);

CREATE TABLE IF NOT EXISTS scan_cache (
    symbol VARCHAR(20) NOT NULL,
    data_type VARCHAR(50) NOT NULL,
    interval VARCHAR(20) NOT NULL DEFAULT '',
    payload JSONB NOT NULL,
    fetched_at TIMESTAMP WITH TIME ZONE NOT NULL,
    PRIMARY KEY (symbol, data_type, interval)
);
CREATE INDEX IF NOT EXISTS ix_scan_cache_symbol_data_type ON scan_cache (symbol, data_type);

CREATE TABLE IF NOT EXISTS ohlcv (
    time TIMESTAMP WITH TIME ZONE NOT NULL,
    symbol VARCHAR(20) NOT NULL,
    open NUMERIC(20, 4),
    high NUMERIC(20, 4),
    low NUMERIC(20, 4),
    close NUMERIC(20, 4),
    volume BIGINT,
    PRIMARY KEY (time, symbol)
);

CREATE TABLE IF NOT EXISTS sessions (
    id BIGSERIAL PRIMARY KEY,
    isin VARCHAR(20) NOT NULL,
    title VARCHAR(255),
    created_at TIMESTAMP WITH TIME ZONE,
    scan_context JSONB,
    sub_agent_summaries JSONB
);

CREATE TABLE IF NOT EXISTS messages (
    id BIGSERIAL PRIMARY KEY,
    session_id BIGINT NOT NULL REFERENCES sessions (id),
    role VARCHAR(20) NOT NULL,
    content TEXT NOT NULL,
    created_at TIMESTAMP WITH TIME ZONE
);

CREATE TABLE IF NOT EXISTS stocks (
    isin VARCHAR(20) PRIMARY KEY,
    name VARCHAR(255) NOT NULL
);


COMMIT;
